  console.log('Clicou no botão UM!');
}

function handleClickTwo() {
  console.log('Clicou no botão DOIS!');
}

function handleClickThree() {
  console.log('Clicou no botão TRÊS!');
}

class App extends React.Component {
  render() {
    return (
    <div>
    <button onClick={ handleClickOne }>Botão</button>
    <button onClick={ handleClickTwo }>Botão</button>
    <button onClick={ handleClickThree }>Botão</button>

    </div>)
  }
}

export default App;
